(1, 'Consolcargo SAS, con 12 años de experiencia en la industria como NVOCC, con cobertura mundial en exportaciones e importaciones, llegando a donde usted necesite.', 'http://190.26.81.138/tracking', 'https://www.zonapagos.com/t_consolcargo/pagos.asp', 'http://www.consolcargo.com/secciones/itinerario', '0dc6587c3c1079ace2e1d71f4bdb34e3.jpg', 'NO', 'NO', 'SI');
INSERT INTO `cms_detalle_servicios` (`id`, `texto`, `imagen`, `texto_contactenos`, `id_servicio`, `titulo`) VALUES
(1, '<h2>Ofrecemos:</h2>\n\n<ul>\n      <li>Neutralidad.</li>\n      <li>Tiempos eficientes de desconsolidacion.</li>\n      <li>Cumplimiento en salidas de exportacion e importacion.</li>\n      <li>Triangulaciones.</li>\n      <li>Facturacion via email.</li>\n      <li>Acceso a la web de Consolcargo para el seguiento de su carga (Web Tracking).</li>\n    </ul>', 'c5ec6e77bea2063d3e55d86f7d0d417e.jpg', 'Comunícanos tu requerimiento completando el siguiente formulario y te responderemos a la menor brevedad.', 1, 'Somos lideres en el manejo de carga suelta para exportación e importación marítima en Colombia.'),
(2, '<h2>Ofrecemos:</h2><ul><li>Certificación IATA.</li><li>Agilidad.</li><li>Personal con la experiencia en el manejo de esta operación.</li><li>cobertura, red de agentes.</li><li>Facturación vía mail.</li><li>Acceso a la web de Consolcargo para el seguimiento de su carga (Web Tracking).</li></ul><br><br>', '7a4f01d6018e03470ec01cfaf6a7df5f.jpg', 'Comunícanos tu requerimiento completando el siguiente formulario y te responderemos a la menor brevedad.', 2, 'Para sus cargas aéreas que requieran un manejo rápido y oportuno.'),
(3, '<h2>Ofrecemos:</h2><ul><li>Coordinación completa de la operación.</li><li>Cobertura con una amplia Red de agentes.</li><li>Contratos a nivel mundial con preferencias en tarifas de exportación.</li><li>Preferencias con lineas navieras en depósitos y en Dropoff.</li><li>Facturación vía email.</li><li>Acceso a la web de Consolcargo para el seguimiento de su carga (Web Tracking).<br></li></ul>', '9fc87ead3e0d5784b5ec496291d1fe7e.jpg', 'Comunícanos tu requerimiento completando el siguiente formulario y te responderemos a la menor brevedad.', 3, 'Para la operación logística de su contenedor.'),
(4, '<h2>Ofrecemos:</h2><ul><li><span style="font-size: 10pt;">Precios competitivos.</span></li><li>Cobertura en toda Asia.</li><li>Servicio intermedio.</li><li>Seguridad en el manejo de la carga.</li><li>Facturación vía mail.</li><li>Acceso a la web de Consolcargo para el seguimiento de su carga (Web Tracking).</li></ul>', 'f8b6a0829f3977bc58e032600a35eed4.jpg', 'Comunícanos tu requerimiento completando el siguiente formulario y te responderemos a la menor brevedad.', 5, 'Para la operación logistica de su contenedor'),
(5, '<h2 style="outline: none; -webkit-tap-highlight-color: rgba(255, 255, 255, 0); color: rgb(50, 50, 50); font-family: Pt-R; font-size: 1em; padding: 0px 0.5em; background-color: rgb(245, 246, 246);">Ofrecemos:</h2><ul><li style="font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant: normal; font-weight: normal; line-height: normal;">Manejo propio de esta operación, no utilizamos intermediarios.</li><li style="font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant: normal; font-weight: normal; line-height: normal;">Salidas semanales en consolidado desde Cartagena y Buenaventura a Bogotá y Medellín.</li><li style="font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant: normal; font-weight: normal; line-height: normal;">Personal dedicado para su operación.</li><li style="font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant: normal; font-weight: normal; line-height: normal;">Facturación vía email.</li></ul>', '8160095b99d824385f9e26084b2d9f8c.jpg', 'Comunícanos tu requerimiento completando el siguiente formulario y te responderemos a la menor brevedad.', 4, 'Posterior a la operación marítima, continúe a través de nuestros servicios terrestres de carga nacionalizada y en OTM.'),
(6, '<h2>Ofrecemos:</h2>\n    <ul><li>Cobertura con la red de agentes.</li><li>Conocimiento.</li><li>Aliados estratégicos para el manejo Door to Door.</li><li>Facturación vía email.</li><li>Acceso a la web de Consolcargo para el seguimiento de su carga (Web Tracking).<br></li></ul>', '2c75fbd6dc242ee205cd1a2165c5014b.jpg', 'Comunícanos tu requerimiento completando el siguiente formulario y te responderemos a la menor brevedad.', 6, 'Para carga especial que no se ajuste a un contenedor.'),
(7, 'Permite  respaldar la carga en cualquiera de las etapas de la cadena logística.', '781dec57faefb2fc97c06c780eb28945.jpg', 'Comunícanos tu requerimiento completando el siguiente formulario y te responderemos a la menor brevedad.', 7, '.');
